import React from 'react'
import { blogposts } from '../data.js'

const Posts = () => {
  return (
    <div>
      <h2>Blog Posts:</h2>
      {blogposts.map((blogpost) => (
        <div className='blogposts' key={blogposts}>
          {blogpost}
        </div>
      ))}
    </div>
  )
}

export default Posts
